import React from 'react';

function ImagePopup( name, isOpen, onClose ) {
  return (
    <div className={`popup popup_type_${name} + (isOpen && " popup_opened")`}>
        <figure className="popup__open-image">
            <button 
              className="popup__close popup__close_type_image" 
              type="button" 
              aria-label="Закрыть">
              onClick={onClose}
            </button>
            <img className="popup__image" src="#" alt="#"/>
            <figcaption className="popup__place"></figcaption>
        </figure>
    </div>
  );
}

export default ImagePopup;
